def train_ner_model(output_dir="my_ner_model", n_iter=30):
    """
    Train a spaCy NER model for Thai calendar event extraction
    """
    print("=" * 60)
    print("Training spaCy NER Model")
    print("=" * 60)
    
    # Create blank Thai model
    print("\n1. Creating blank model...")
    nlp = spacy.blank("xx")  # Using 'xx' for multilingual support
    
    # Add NER pipeline
    print("2. Adding NER pipeline...")
    ner = nlp.add_pipe("ner")
    
    # Add labels
    print("3. Adding entity labels...")
    labels = ["ACTIVITY", "DATE", "TIME", "END_TIME", "LOCATION", "PERSON"]
    for label in labels:
        ner.add_label(label)
    
    print(f"   Labels: {labels}")
    
    # Initialize the model
    print("4. Initializing model...")
    nlp.initialize()
    
    # Convert training data to spaCy format
    print("5. Preparing training data...")
    training_examples = []
    for text, annotations in TRAIN_DATA:
        doc = nlp.make_doc(text)
        example = Example.from_dict(doc, annotations)
        training_examples.append(example)
    
    print(f"   Total training examples: {len(training_examples)}")
    
    # Train the model
    print(f"\n6. Training for {n_iter} iterations...")
    other_pipes = [pipe for pipe in nlp.pipe_names if pipe != "ner"]
    with nlp.disable_pipes(*other_pipes):
        optimizer = nlp.create_optimizer()
        
        for iteration in range(n_iter):
            random.shuffle(training_examples)
            losses = {}
            
            # Batch training
            batches = minibatch(training_examples, size=8)
            for batch in batches:
                nlp.update(batch, sgd=optimizer, losses=losses, drop=0.35)
            
            if (iteration + 1) % 5 == 0:
                print(f"   Iteration {iteration + 1}/{n_iter} - Loss: {losses['ner']:.2f}")
    
    # Save the model
    print(f"\n7. Saving model to {output_dir}...")
    output_path = Path(output_dir)
    nlp.to_disk(output_path)
    
    print("\n" + "=" * 60)
    print(f"✓ Model saved successfully to: {output_path.absolute()}")
    print("=" * 60)
    
    # Test the model
    print("\n8. Testing model...")
    test_texts = [
        "พรุ่งนี้มีประชุมตอน 10 โมง",
        "วันจันทร์นัดหมอ 3 โมง",
        "เสาร์ไปมอกับบีม"
    ]
    
    for text in test_texts:
        doc = nlp(text)
        print(f"\n   Text: {text}")
        if doc.ents:
            for ent in doc.ents:
                print(f"      → {ent.text:15s} ({ent.label_})")
        else:
            print("      → No entities found")
    
    return nlp

if __name__ == "__main__":
    # Train and save the model
    model = train_ner_model(output_dir="my_ner_model", n_iter=30)
    print("\n✓ Training complete!")
    print("  You can now use this model in the Streamlit app.")
